    "authorType": "human",
    "description": "Relax with the whole family at this peaceful and highly secured and gated estate  to stay.\n\nThis stylish four bedroom house is situated in a highly secured and gated estate named lekki gardens estate phase 2, lekki , epe, lagos. It comprises of three large rooms upstairs and one medium room downstairs. Each room upstairs is well fiited with  6 by 7 royal beds, dressing mirrors, wordrobe, 43 inches TV.  The room downstairs has 43 inches TV as well with a double bed ( 4 x 6) . Each of the four rooms has 1 hp split unit airconditioner unit while the living room has two 1 hp split unit airconditioner ensuring the entire house is cool no matter how hot the temperature is.  There are a total of four toilets and three bathrooms. The masters bedroom upstairs and the room downstairs are ensuite while two other rooms upstairs share same toilet and bathroom.  The living room has a seperate toilet. The living room/ palour is situated downstairs and is well fitted with an 86 inches cinema style smart 4k LG TV and wifi access so guests can stream movies. The well spaced elegant kitchen is situated downstairs and fitted with five burner set family size gas cooker, american fridge freezer and all a family needs to cook with like exotic toaster, kettle, washing machine and others.\n\nGuests who book the entire house has access to every part of the house.\n\nThe property is situated in a highly secured estate with 24/7 security patrol officers. It has one gate acces that screens who goes in and out so you do not need to worry about  your security and that of your kids.\n\nThe property has a large space around it for guest's use as well like walk way and open space at front and back where guests can sit ans relax",
