    "authorType": "human",
    "description": "Forget your worries in this spacious 4-bedroom duplex and serene space with 24hours power supply. The kitchen is with the highest cooking utensils, a beautiful balcony for relaxation, variety of games in the apartment for entertainment. This apartment has all modern conveniences including security cameras and 24/7 professional gated security guards. It’s a 7mins drive to the Lekki Conservation Center, 4mins to Prime Mall Lekki and Mega 1 Cinema. 15mins from amazing restaurants within Lekki.\n\nIt’s a 4- bedroom all en-suite that comes with a water heater in all the rooms including the kitchen and super cooling air-conditions with 24 hours power supply. The masters bedroom comes with a hot tub and has a balcony. Games like soccer table, PS4, Ayoo (local game) are available to entertain you. Security cameras are stationed in the common areas of the apartment and there’s 24/7 security guards within the estate to ensure maximum security.\n\nHot tub is always accessible and there are games like soccer table, PS4, ayoo (African game), card games etc to keep guests entertained.\n\nI’m available to assist via phone, text or email.\n\nIt has access to conservation center which is few minutes away and also Mega Chicken where you have different types of dishes both local and international.\n\nThe best way to get around is via using a cab",
