      "comments": "Location was A+++++<br/>All facilities at the property were excellent with the pool being a cherry on the top. <br/>The security guards and caretaker, Usman were friendly and responsive. <br/>I will recommend Lagoon Paradise to families of four or more looking for a premium residential abode whenever they want to visit Lagos (the Island to be specific).<br/>We would certainly be back again.<br/>Thank you, Wale!",
