    "description": "&zwj;\n\nFurnished 4 bedroom semi-detached duplex is fitted with all essentials you need in a home, pure white walls and colorful accents, equipped with well maintained and quality services ranging from kitchen amenities, Washing machine, Water heater, Air conditioner, cozy bedrooms, 24 hrs Wifi, Tv, DSTV and explicable amenities.\n\nSnuggle up in our luster bed or couch in front of a movie at this chilled space in shades of white and luminous colors. The kitchen door opens up to a beautiful greeny space for serene afternoons.\n\nGuests have full access to the house and its amenities which includes;\n\n- 24 Hours Security\n- 24 Hours of Electricity\n- 2 Private Balcony\n- Private Parking for 2 Vehicle\n- Private and General Gym\n- General Swimming Pool\n- Playground for Kids\n- Available Mini Football Peach\n- Green Area Landmark\n- Panoramic View",
